import React  from "react";
import axios from 'axios';
import Table from 'react-bootstrap/Table';



const Pizza = props =>{
    const [data, setData] = React.useState([]);
    let datarows = React.useState([]);
    let datacols = React.useState([]);
    let columns = []
    let rows = []

    React.useEffect(()=>{
        axios('http://localhost:5000/pizza')
        .then(response=>{
            if(response.status===200){
                const datarows =response.data.rows;
                console.log('----------------------s')
                for (let i = 0; i < datacols.length; i++){
                  datacols = response.data.metaData[i];
                  columns.push(datacols)
                  console.log(columns)
                }
                for (let i = 0; i < datarows.length; i++){
                  datacols = response.data.rows[i].name;
                  columns.push(rows)
                  console.log(rows)
                }
                console.log(rows)
                console.log(columns)
                //const datacols = response.data.metaData[].name;
                console.log(datacols)
                console.log(datarows);
                setData(datarows);
            }
        })
        .catch(err=>{
            console.log(err);
        })
    },[]);

    let datadisplay=<div id='datadisplay'>----</div>;

    const test = () => {
        console.log('TEST')
        axios('http://localhost:5000/pizza')
            .then(response=>{
                if(response.status===200){
                    datadisplay=<div id='datadisplay'>test</div>
                    datarows =response.data.rows;
                    console.log(datarows);
                    setData(datarows);
                    console.log(datarows[1]);
                    console.log(columns)
                    //return (datadisplay)
                }
            })
            .catch(err=>{
                console.log(err);
            })
    }

    return(<div>
        Pizza Component
        {
            data.length>0 &&
            data.map((item,index)=>
            <div key={index}>{index}-{item}</div>)
        }

        <button id='button' onClick={test}>TEST</button>
        {datadisplay}


        <Table striped bordered hover size="sm">
        <thead>
        <tr>
          <th>#</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Username</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
        <tr>
          <td>2</td>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
        </tr>
        <tr>
          <td>3</td>
          <td colSpan={2}>Larry the Bird</td>
          <td>@twitter</td>
        </tr>
      </tbody>
        </Table>
    </div>)
}

export default Pizza;
